  input: TEXT,F3XN,,"ITEMIZED DISBURSEMENTS  --  Prior to October 25, 2003, the Committee
    paid its payroll and related payroll tax expenditures from its Federal Account.  After
    October 24, 2003, the Committee paid payroll related expenditures out of its non-federal
    account.  During this reporting period (7-1-03 to 12-31-03), none of the committee's
    employees worked more than 25% of their time on Federal Election Activities.  The
    Bipartisan Campaign Reform Act of 2002 prohibits a state committee from treating
    its staff's wages as allocated expenses and reporting those expenditures on Schedule
    H/4.  Accordingly, the wages and related wage expenditures paid form the committee's
    Federal Account before October 25, 2003, has been reported on Schedule B as an
    itemized disbursment."
